U cilju istinitog informiranja javnosti, moram se pitati da li Emil Gredičak namjerno piše lažne postove ili stvarno ne kuži da je 4 godine radio u najmanju ruku jako loše?! 

Prvo je odustao od projekta svlačionica koji je dobio građevinsku dozvolu i projektirao nove svlačionice sistemom modularne gradnje, a sve pod krinkom jeftinije izgradnje za koju je tvrdio da iznosi otprilike 840 tisuća kuna. 

Kad je raspisao natječaj došla je jedna ponuda i to na 2.759.146,25 kuna s pdv-om, što je još gore cijena ponude nakon provjere računske ispravnosti ponude iznosi 3.825.809,13 kn s pdv-om. 

Naravno da sam natječaj poništio, što mi je bila i zakonska obaveza i tražio rješenja koja su našem budžetu prihvatljiva. Temeljem članka 298. stavka 1. točke 9.  ZJN 2016 javni naručitelj obvezan je poništiti postupak javne nabave ako je cijena najpovoljnije ponude veća od procijenjene vrijednosti nabave, osim ako javni naručitelj ima ili će imati osigurana sredstva.

Što više i u Zapisniku o pregledu i ocjeni ponuda koji su ovjerili predstavnici stručnog povjerenstva Naručitelja, u sastavu Stanko Čičko (tadašnji predsjednik Gradskog Vijeća), Zdenka Knezić i Stana Kurtov donijeli su zaključak o razlozima za poništenje postupka nabave “jer je cijena ponude znatno veća od planiranih odnosno osiguranih sredstava, Naručitelj će poništiti ovaj postupak javne nabave”. 

Naravno da je Emil Gredičak o ovome sve znao i za sad toliko o istinitom informiranju javnosti bivšeg gradonačelnika!

 Prendi poi l’acqua benedetta e fa bene e con lentezza il segno della nostra redenzione: il segno della Croce.

  Appena sei in vista del Dio Sacramentato (c’e un Altare dove si conserva l’Eucaristia, e segnalato da una lampada accesa), fa devotamente la genuflessione piegando il ginocchio fino a terra; saluta prima Lui, il tuo Signore – vivo e vero nel Tabernacolo – poi vengono la Madonna e i Santi.

    Trovato il posto, inginocchiati e rendi a Gesu Sacramentato il tributo della tua preghiera e della tua adorazione. 
Confida a Lui tutti i tuoi e gli altrui bisogni, parlaGli con abbandono filiale, da sfogo libero al tuo cuore e lascia piena liberta a Lui di operare in te come meglio Gli piace.Nell’uscire di chiesa abbi un contegno raccolto e calmo: saluta per primo Gesu sacramentato, domandagli perdono delle mancanze commesse alla Sua divina presenza e non partire da Lui se prima non Gli hai chiesto e da Lui non ne hai ottenuta la paterna benedizione.

Uscita che sei di Chiesa, mostrati tale quale ogni seguace del Nazareno dovrebbe essere."-

Dagli Scritti di Padre Pio  da Pietrelcina -

&amp;lt;U+0001F4E3&amp;gt;Gradonačelnik Oroslavja izračunao je otkupnu cijenu mobitela!
 Zahvaljujem gradonačelniku Oroslavja na poslanoj uplatnici na iznos od 1800 kuna, koji sam sa zadovoljstvom odmah uplatio. Nakon što sam od njegove strane prozivan u nacionalnim medijima, dobio sam naposljetku i priliku normalno riješiti ovaj slučaj. Vjerujem da će svi portali ovo napisati, a ja moram ponoviti, najprije zbog svoje djece, obitelji i svih vas mojih prijateljica, prijatelja, poznanica i poznanika.&amp;lt;U+0001F64B&amp;gt;&amp;lt;U+200D&amp;gt;&amp;gt;&amp;lt;U+FE0F&amp;gt;
    &amp;lt;U+0001F4CD&amp;gt; Za telefon i broj sam s istekom mandata preuzeo obvezu plaćanja. (dokaz u prilogu) 
    &amp;lt;U+0001F4CD&amp;gt;Pitao sam u Jedinstveni upravni odjel grada (čiji je to djelokrug rada), da li i dalje postoji bilo kakva obveza koju sam naravno spreman podmiriti. Rečeno mi je da ne postoji ako dalje ja nastavljam plaćati obveze i da predočim dokaz prebacivanja obveze na moje ime. To sam i učinio i to je postupak koji je odobren i mojem prethodniku. 
    &amp;lt;U+0001F4CD&amp;gt;Prozivan sam u nacionalnim medijima kao osoba koja ne želi nešto tuđe vratiti, čak i za drugi mobitel koji ja ne posjedujem-zeleni Samsung S10+. 
    &amp;lt;U+0001F4CD&amp;gt;Ponovno sam spomenuo da sam spreman bilo kakvu obvezu podmiriti ako ona postoji i da sam već i javno i stručnim službama to javio. 
    &amp;lt;U+0001F4CD&amp;gt;Danas, 19.07. Konačno dam dobio uplatnicu s Odlukom gradonačelnika i sa zadovoljstvom platio ne ulazeći uopće u način obračuna.&amp;lt;U+0001F642&amp;gt;
    &amp;lt;U+0001F4CD&amp;gt;Ako treba, vratiti ću i troškove izrade majica za Viktora Šimunića i njegove prijatelje (i novoizabranog potpredsjednika Gradskog vijeća) kada su putovali u Černobil. Naime, tada me kao gradonačelnika Viktor zamolio da mu grad pomogne oko putovanja. Rekao sam da mu preko grada ne mogu pomoći novčano za put, ali ako promoviraju grad u medijima i putopisima, mogu im se izraditi majice sa grbom grada kao reklama i suvenir. Tada sam to smatrao dobrom merketinškom odlukom za grad...

P. S. Još uvijek čekam da Viktor prijavi donacije za video snimke i ostalo u predizbornoj kampanji, a koje je na sučeljavanju na N1 televiziji obećao prijaviti.

   &lt;td style="text-align:left;"&gt; Povijesni uspjeh: Xiaomi je broj jedan u Hrvatskoj i drugi na svijetu

Kineski proizvođač mobilnih telefona i drugih uređaja Xiaomi u Hrvatskoj po isporuci pametnih telefona zauzima prvo mjesto, ostvarivši 40 posto tržišnog udjela te godišnji porast od 65 posto, obavještavaju iz ureda Xiaomi Internationala za Hrvatsku i Sloveniju.

"Ovo je povijesni Xiaomijev rezultat u Hrvatskoj", kaže Mirela Polić, marketinška menadžerica te kompanije za Hrvatsku i Sloveniju, dodavši kako se ti rezultati temelje na podacima nekoliko globalnih analitičkih i istraživačkih kuća za globalno tržište pametnih telefona (Canalys, IDC i Strategy Analytics).

U Hrvatskoj je, po tim podacima, iza Xiaomija, na drugom mjestu po broju isporučenih pametnih telefona Samsung, sa tržišnim udjelom od 36 posto i porastom isporuka od 25 posto, dok je treći Apple s udjelom na tržištu od 6 posto i porastom od 17 posto. Na četvrtom je mjestu HMD Global s udjelom od 4 posto, i porastom isporuka od 210 posto.

Što se tiče svjetskog tržišta, Xiaomi bilježi ogroman porast i trenutno je na drugom mjestu iza Samsunga.

"Dobili smo izvješće Canalysa, vodeće svjetske tvrtke za istraživanje tržišta o globalnom tržištu pametnih telefona na kojem je Xiaomi zauzeo drugo mjesto sa 17 posto udjela i 83 posto međugodišnjeg rasta, nadmašivši Apple", kaže Mirela Polić te dodaje kako je: "Canalys objavio da Xiaomi sada transformira svoj poslovni model iz izazivača u pozicioniranog lidera pametnih telefona i to zahvaljujući inicijativama poput konsolidacije partnera i pažljivijeg upravljanja na otvorenom tržištu. Canalys je komentirao da je novi cilj Xiaomija istisnuti Samsung kako bi postao najveći svjetski prodavač".

U pismu svim zaposlenicima, Lei Jun, osnivač, predsjednik i izvršni direktor Xiaomija, istaknuo je da je zauzimanje drugog mjesta na globalnom tržištu ključna prekretnica u povijesti Xiaomijeva poslovanja. "Nakon pet godina kontinuiranog ulaganja u segmentu unaprjeđenja, a koje se odvijalo u izuzetno teškim uvjetima, Xiaomijeve proizvodne mogućnosti znatno su poboljšane. Xiaomi je otvorio put u premium segment tržišta i povećao svoj tržišni udio. Xiaomi će kontinuirano jačati svoje temeljne sposobnosti i učvršćivati svoje mjesto kao drugi najveći brend pametnih telefona", rekao je Lei Jun.

Inače, započela je s radom prva faza Xiaomijeve pametne tvornice. Proizvodne linije su automatizirane i sposobne proizvesti milijun vrhunskih pametnih telefona godišnje, a tu je ujedno i ogroman laboratorijski pogon koji Xiaomiju omogućuje istraživanje novih materijala i tehnologija, kao i testiranje naprednih proizvodnih i proizvodnih procesa. Inovacije su dio Xiaomijeve kulture i tvrtka znatno ulaže u istraživanje i razvoj i zapošljavanje najboljih talenata. Xiaomi je uložio gotovo 10 milijardi RMB u istraživanje i razvoj 2020. godine, ove godine očekuje se porast broja za od 30 do 40 posto. U međuvremenu, Xiaomi je pokrenuo više inicijativa za poticanje nadarenosti, poput projekta dodjele milijun američkih dolara za tehnološke talente, poticajnog plana za mlade inženjere itd.

Prema najnovijim globalnim podacima o pametnim telefonima Canalysa, Xiaomi se brzo širi na inozemnim tržištima, dosežući preko 300 posto međugodišnjeg rasta na tržištu Latinske Amerike, preko 150 posto međugodišnjeg rasta u Africi i preko 50 posto međugodišnjeg rasta u zapadnoj Europi. Prema najavi rezultata Xiaomi za Q1 2021, pametni telefoni Xiaomi ušli su na više od 100 tržišta širom svijeta, svrstali se na prvo mjesto po udjelu na tržištu pametnih telefona na 12 tržišta i na 2. mjesto u Europi. Godinama je također broj 1 u Indiji. (Ivica Korman) #Kina #Hrvatska #Gospodarstvo #Xiaomi

   &lt;td style="text-align:left;"&gt; Photos from Emil Gredičak, gradski vijećnik's post
Vezano uz novo "plakanje" na Index-u, ispada da sam ipak bio u pravu kad sam odgovorio na izjavu sadašnjeg gradonačelnika da "nije učinjeno apsolutno ništa po pitanju svlačionica unatrag 30 godina". Očito se radilo puno, a naknadnom izjavom i sam sebe demantira kad nabraja kronološki što je sve učinjeno. Što se mobitela i pretplate tiče, za isti sam preuzeo otplatu prestankom mojeg mandata, te sam o tome obavjestio Jedinstveni upravni odjel koji je zadužen za te poslove. Znači, koristio sam ga tijekom rada i prestankom više ne postoji trošak za grad. Ukoliko postoji obveza bilo kakvog plaćanja gradu, naravno da sam spreman platiti i to sam rekao tada i sada opet ponavljam. Rečeno mi je da obveza ne postoji, ako sam preuzeo daljnje plaćanje i pretplatu. Na isti način regulirano je i prebacivanje broja i mobitela i mojem prethodniku prije 4 godine. A Samsung S10+ nije u mojem posjedu. Viktor to također zna. 
P. S. Nekoliko puta sam, pa i na prošlom Gradskom vijeću pokušao objasniti da prva verzija svlačionica, iako lijepa, nije bila projektirana prema standardima lige, trebao bi se rušiti stoljetni hrast, bile bi preblizu igralištu i gradile bi se djelom na potrebnom pomoćnom igralištu...itd. Također, na vijeću nije bez razloga prihvaćen drugi i noviji projekt, za kojega se opet može raspisati gradski natječaj, jer ponavljam, sve drugo je kupovina vremena...vidjet ćete.

   &lt;td style="text-align:left;"&gt; NOVENA AI SANTI GIOACCHINO ED ANNA
GENITORI DELLA BEATA VERGINE MARIA
(dal 17 al 25 luglio)

1° GIORNO

O gloriosa madre di Maria, sant'Anna, per quell'invitta pazienza con cui tollerasti la tua penosa sterilita, ottieni a noi pure una costante rassegnazione in tutti i travagli di questa vita.

Gloria...

- PREGHIERA A SANT'ANNA
(da recitarsi ogni giorno)

Anna, donna veramente beata, dal frutto del tuo seno abbiamo la gioia di contemplare la Madre di Dio fatto uomo.
Madre Anna, quale mente non si sente smarrita e quale pensiero potra rialzarsi tanto in alto da eguagliare l'onore e il privilegio che Dio altissimo ti ha riservato scegliendoti quale madre di Maria.
Madre Anna, ti mantenevi piccola e nascosta, raccolta in una umile casetta o nel segreto del tempio, unita al tuo sposo Gioacchino e attendevi con trepidazione le compiacenze del Padre Celeste che chinandosi su di te ti disponeva ad essere la Nonna di Gesu.
Madre Anna, donna veramente beata, a te affidiamo le nostre preghiere, i nostri bisogni, le nostre ansie, dividili con noi e presentale al tuo nipotino Gesu.
Stringici a te, portaci in braccio come facevi con Maria e non lasciarci fino a quando non ti raggiungeremo nella Patria Beata. Amen

Sant'Anna, madre della Madre di Dio, prega per noi.

- PREGHIERA A SAN GIOACCHINO
(da recitarsi ogni giorno)

O grande e glorioso san Gioacchino, quanto sono felice pensando che fosti eletto fra tutti i santi a cooperare ai divini misteri e ad arricchire il mondo della Madre di Dio, Maria Santissima! Per questo singolare privilegio divenisti potentissimo presso la Madre e il Figlio, per ottenerci le grazie necessarie. Con tale fiducia ricorro alla tua protezione e ti raccomando tutte le necessita mie e della mia famiglia, spirituali e temporali; ti raccomando inoltre la grazia particolare che desidero e che attendo dalla tua paterna intercessione... e poiché fosti modello perfetto di vita interiore, ottienimi il raccoglimento e il distacco da tutti i beni passeggeri di questa terra e un amore vivo e perseverante a Gesu e a Maria. Ti prego d'implorare per me all'Eterno Padre devozione e obbedienza sincera alla santa Chiesa e al sommo Pontefice che la governa, e ti prego di chiedere al Signore che io possa vivere e morire nella fede, speranza e carita perfette, invocando i nomi Santissimi di Gesu e di Maria, e salvarmi. Amen.

Gloria...

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

 2° GIORNO

O gloriosa madre di Maria, sant'Anna, per la fervorosa ed incessante preghiera con cui chiedevi a Dio di essere consolata con la fecondita, ottienici un vero spirito di preghiera per accrescere nel nostro cuore sante virtu.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

 Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

 3° GIORNO

O gloriosa madre di Maria, sant'Anna, per la rigorosa mortificazione che unisti alle tue preghiere per essere piu facilmente esaudita da Dio, fa' che anche noi accompagniamo il fervore dell'orazione con lo spirito della mortificazione per renderci meritevoli di grazie celesti.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

 Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

~*~*~*

4°  GIORNO

O gloriosa madre di Maria, sant'Anna, per la dolce violenza che facesti al Cuore di Dio con le tue grandi elemosine ed opere di carita, ottienici dal Signore una carita simile alla tua, affinché Egli abbia misericordia di noi.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

 Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

 5° GIORNO

O gloriosa madre di Maria, sant'Anna, per la santa fiducia con cui speravi la realizzazione dei tuoi desideri, ottienici una fiducia fermissima, con cui ci assicuriamo i favori del Cielo.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

 Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

6° GIORNO

O gloriosa madre di Maria, sant'Anna, per la grande riconoscenza che dimostrasti a Dio quando ti accorgesti di divenire madre per sua grazia, fa' che siamo sempre grati e riconoscenti a Dio per i continui favori che riceviamo da Lui e ci rendiamo degni di riceverne ancora.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

7° GIORNO

O gloriosa madre di Maria, sant'Anna, per quel puro e santo amore che concepisti verso Maria quando diventasti sua fortunatissima madre, ottienici di amare sempre questa tua Figlia cosi santa e nostra Madre cosi cara, per meritarci la sua protezione.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

8° GIORNO

O gloriosa madre di Maria, sant'Anna, per il grande sacrificio di offrire la tua Bambina fin dai piu teneri anni al divino servizio del tempio, ottienici di poter con santo coraggio sacrificare a Dio qualunque cosa Egli voglia chiederci per obbedire alla sua santa Volonta e per ottenere le sue benedizioni.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

9° GIORNO

O gloriosa madre di Maria, sant'Anna, per quella santita fervorosa con cui servisti Dio in tutti i giorni della tua vita, degnati di pregare il Signore di farci vivere da giusti e santi sino alla fine dei nostri giorni.

   &lt;td style="text-align:left;"&gt; Medij: Tehnološki rat između Kine i SAD-a će skupo koštati svijet

Sjedinjene Američke Države pokušavaju obuzdati uspon Kine u takozvanom tehnološkom hladnom ratu, koji postaje odlučujuća bojišnica za konkurenciju između dvije zemlje, navedeno je u članku koji je nedavno objavio australski medij ABC News.

Kina je tijekom posljednjih godina ulagala znatna sredstva u umjetnu inteligenciju, 5G i 6G tehnologiju, mikročipove i tehnologiju za nadzor, brzo sustižući Sjedinjene Američke Države koje su dugo imale prednost u tehnologiji, navedeno je u članku.

Sjedinjene Američke Države pokušavaju suzbiti razvoj Kine u tehnološkoj industriji. Zabranile su Huaweijevu 5G mrežu u zemlji i učinkovito spriječile da tvrtke iz SAD-a opskrbljuju kineske tehnološke tvrtke softverom i komponentama.

Međutim, analitičari upozoravaju da će takvi sukobi samo učvrstiti “digitalnu željeznu zavjesu” između Zapada i Kine, dodajući kako se svijet dijeli između dva sukobljena i uzajamno isključujuća tehnološka ekosustava, koji svaki ima vlastite internetske, hardverske, komunikacijske i financijske platforme.

“Tehnološki rat je izazvao žrtve na obje strane i skupo će koštati svijet”, navedeno je u članku. &lt;/td&gt;

   &lt;td style="text-align:left;"&gt; NOVENA AI SANTI GIOACCHINO E ANNA GENITORI DELLA B.V. MARIA
(dal 17 al 25 luglio)

4° Giorno 20 luglio
O gloriosa madre di Maria, sant'Anna, per la dolce violenza che facesti al Cuore di Dio con le tue grandi elemosine ed opere di carita, ottienici dal Signore una carita simile alla tua, affinché Egli abbia misericordia di noi.
Gloria al Padre...
Sant'Anna, madre della Madre di Dio, prega per noi.

PREGHIERA A SAN GIOACCHINO (da recitarsi ogni giorno)
O grande e glorioso san Gioacchino, quanto sono felice pensando che fosti eletto fra tutti i santi a cooperare ai divini misteri e ad arricchire il mondo della Madre di Dio, Maria Santissima! Per questo singolare privilegio divenisti potentissimo presso la Madre e il Figlio, per ottenerci le grazie necessarie. Con tale fiducia ricorro alla tua protezione e ti raccomando tutte le necessita mie e della mia famiglia, spirituali e temporali; ti raccomando inoltre la grazia particolare che desidero e che attendo dalla tua paterna intercessione... e poiché fosti modello perfetto di vita interiore, ottienimi il raccoglimento e il distacco da tutti i beni passeggeri di questa terra e un amore vivo e perseverante a Gesu e a Maria.
Ti prego d'implorare per me all'Eterno Padre devozione e obbedienza sincera alla santa Chiesa e al sommo Pontefice che la governa, e ti prego di chiedere al Signore che io possa vivere e morire nella fede, speranza e carita perfette, invocando i nomi Santissimi di Gesu e di Maria, e salvarmi. Amen.
Gloria al Padre...
San Gioacchino, felice padre della Madre di Dio, prega per noi.

   &lt;td style="text-align:left;"&gt; Ivančica Markovinović Huawei Vaš je napisani tekst vrijedan divljenja i tu nema ništa spornoga. Veoma bogato opisan njegov rekao bih to Križni put sa mnogim zaprekama koje su iskrsle ispred njega i sve je to vrijedno divljenja i poštovanja. Ono o čemu sam ja napisao moje je viđenje cjelokupne priče o situaciji u kojoj se trenutno našao. Uz dužno poštovanje nemam namjeru nabrajati ni dobre ni loše političare ni ljude jer svatko od njih ostaviti će svoje tragove za budućnost za one koji njihovo dejstvovanje žele vagati ili ocijenjivati. Moje je mišljenje da niti jedan politički aktivista nije zaslužio prolaznu ocjenu spram svih obećanja koja su nudili Narodu koji je želio vjerovati tim obećanjima a kroz sve ove godine provlačila su se samo razočaranja u sve i svakoga. Živjeli smo u vjeri da uz sva prirodna bogatstva kojima nas je sama priroda nagradila samo mali korak treba do sreće u koju smo vjerovali ali to se dogodilo nije. Ostale su samo prazne riječi od kojih nitko osim Elite nikakve koristi nije imao što je vidljivo iz trenutnog viđenja Naroda koji je doživio razočaranje i teško da će u dogledno vrijeme itko na političkoj sceni promijeniti nešto na bolje. Moje pisanje teksta o Škorinom povlačenju sa mjesta Predsjednika Domovinskoj Pokreta je moje viđenje cjelokupne priče. Jedino čemu se mogu nadati da nije odustao od svega iz zdravstvenih razloga jer sve drugo je bio njegov osobni odabir. &lt;/td&gt;

   &lt;td style="text-align:left;"&gt; Dragana Marjanović znaći, možemo zaključiti:
- bez veze je slušati struku?
- vi ne slušate struku jer to znate bolje od njih?

Da, krenimo od početka, tko je objavljivao da ljudi padaju? Koliko sam ja primjetio nije javna televizija, niti poznati doktori, niti ozbiljni portali, nego žuta štampa koja i sada radi po principu: “primio cjepivo, klikni i vidi što se tada dogodilo”, obavezno like. Propagandu su širili nebitni portali i novine kako bi skupili lajkove i klikove. Isto kao i: “klikni i napiši da, i na kućnu adesunti stiže iphon”, ili upiši da i prvih 1000 dobija novi Samsung, ljudi klikaju i vjeruju.

Uvijek neki čudni portali. 

Imao sam prilike upoznati ljude mlađe od mene koji su u dobroj formi te su imali strašnih problema. Imao sam priliku jer mi je takav posao, pričati sa mnogim doktorima koje poznajem godinama, koji djeluju u raznim ustanovama u svojoj branši, i mogu vam reći da oni koji tvrde da je to izmišljotina i bezazleno, čisto pres….. onih koji žele biti doktori iznad doktora a do jučer su se bavili sa svime i svaćime. Oduvijek su ljudi umirali i od drugih cijepiva, nema lijeka od kojeg nema nus pojava, nema garancije za ništa, ali svi očekujemo da nam ri isti doktori pomognu kada smo u frci i bolesni, a sada ih pljujemo a sebe prozivamo velikim stručnjacima. Ako ke takvo nepovjerenje i sumnja i njihovu stručnost, zašto ih koristite kada ste bolesni, nemojte ići na pretrage ni jednom doktoru, kada budere bolesni liječite se sami doma jer vi to znate. Stvarno ne razumijem. Gospđa mi tu navodi kako ona gleda Youtube a ne televiziju., o isusek…., gleda a sa druge strane uopće nezna dali je pouzdani izvor i u to vjeruje. Ja sam za to da se nikoga ne sili na cijepljenje, ali ako obolite snosite trošak liječenja ili uplatite dodatno osiguranje. Kada idete na bilo kakvu operaciji isto morate potpisati. &lt;/td&gt;

Coventry-based biotech grabs L6.2M funding to develop its novel biologic delivery platform
Coventry-based biotech, NanoSyrinx has raised a further L6.2m of seed financing, co-led by incoming Octopus Ventures and existing investor M Ventures (Amsterdam, The Netherlands), the corporate venture capital arm of Merck KGaA.
Previous investors BioCity and the UK Innovation &amp;amp; Science Seed Fund (UKI2S) joined the funding round along with experienced deeptech investor IQ Capital and Jonathan Milner. The round was significantly oversubscribed with high demand both from existing and from new investors.
Transforming treatments
NanoSyrinx is the first company to engineer protein ‘nanosyringes’, a cell-selective non-viral peptide and protein delivery system. Targeted delivery of therapeutics is an important solution to improve efficacy and minimise potential side effects of existing and new treatments. NanoSyrinx’s technology has the potential to transform the treatment of a wide range of diseases. The system overcomes a number of challenges experienced in intracellular delivery such as cell specificity, payload limitations and manufacturing complexities.
The company will use this investment to fully investigate the applications of its technology across a range of therapeutic indications and novel modalities. Proof-of-concept studies both for in vivo active pharmaceutical delivery and ex vivo cell engineering will be undertaken to better understand the optimal clinical targets and to build a pipeline of programmes to take forward in the next phase of growth.
Dr Joe Healey, CEO of NanoSyrinx, commented: “We’re thrilled that all our current investors have recognised the tremendous progress made by the company in 2020 and have chosen to continue supporting us. It is also a pleasure to welcome Octopus, IQ Capital and Jonathan Milner to the syndicate and we’re delighted to be working together. This investment will help us develop our approach to best target those therapeutic areas where we can make the biggest impact.”
Dr Uzma Choudry, early-stage investor at Octopus Ventures, commented: “Targeting diseased cells without affecting healthy cells is the holy grail of medicine. That’s why we’re so excited to be backing the brilliant NanoSyrinx team in developing their targeted (biologics) delivery platform to treat disease. The initial applications of this technology will be the cell and gene therapy space, where we could see it being used to create highly effective cancer treatments with significantly reduced side effects. The opportunity is enormous and we are looking forward to working with Joe and the team to help make NanoSyrinx’s vision a reality.”
Dr Arnaud Autret, Investment Principal at M Ventures, said: “NanoSyrinx has made very good progress since our pre-seed investment and we are excited to continue backing the NanoSyrinx team and to welcome strong new investors. This new raise will support further developments of this truly differentiated approach in the field of non-viral delivery systems for cell and gene therapy, a high-growth market.”
NanoSyrinx Ltd was founded in 2020 to develop a fully customisable genetic platform that selectively delivers peptide and protein payloads directly to the cytosol of targeted cells. It was first identified by the Waterfield Lab based at Warwick Medical School at the University of Warwick.

Orange Group CIO appointed as newest Board Member of TM Forum
TM Forum appoints Orange Group CIO, Koen Vermeulen, as Board Member to drive industry innovation
The appointment coincides with the re-election of Chairman Steffen Roehn, and a rapid period of growth for TM Forum including over 100 new members
TM Forum, the industry association driving digital transformation through collaboration, announces Koen Vermeulen, Orange Chief Information Officer, and Senior Vice President of Orange Innovation IT and Services, to its Board of Directors. The appointment of Koen Vermeulen comes as part of a period of momentum at TM Forum including a recent partnership with the Tech Talent Charter to help drive inclusivity and diversity in the telco industry, the addition of over 100 new members during 2020_21, increased high-impact co-innovation through its global Catalyst program and industry defining advancements to achieve its zero-touch objectives through its Open Digital Architecture (ODA.)
Koen Vermeulen brings a wealth of experience spanning 20+ years in telco and the internet industries, alongside innovation and digital transformation, to TM Forum’s Board of Directors. Specifically, he expands on the Board’s knowledge of delivering innovative B2C and B2B communication services. Under his leadership as CIO at Orange in France, he has accelerated the implementation of a digital and information strategy that is transformative in its ambition to deliver cutting-edge solutions for Global customers.
The Board, which also includes senior executives from Axiata, BT, China Mobile, Deloitte, Deutsche Telekom, Ericsson, Huawei, Microsoft, Nokia, Oracle, Telenor and Verizon, has overall responsibility for TM Forum on behalf of its more than 850 members. Its key responsibilities are to determine how the Forum will serve the industry, set strategy, direction, and priorities, and guide strategic initiatives. Of the now 15 board members with the appointment of Koen Vermeulen, 10 have recently been reappointed to a further two-year term with four members at the mid-term stage. The continued terms of the senior executives already on the Board shows the strength of the various trustees and their commitment to continue bringing value and innovation to the industry.
On his appointment, Koen Vermeulen comments: “The worldwide telco movement for digital transformation will require companies to evolve, rethink traditional models and adopt new activities. We need open innovation and collaboration to drive industry transformation, which is exactly what TM Forum is doing. I am honoured to join the Board and share my ambition for the industry and contribute to the work the Forum is achieving.”
Alongside continuing vice chairs, Harmeen Mehta, Chief Digital and Innovation Officer, BT and Michael Lawrey, Former TM Forum Chairman, the board chairman is Steffen Roehn, Partner of Bain &amp;amp; Company, a top management consulting firm. Steffen Roehn was first appointed Chairman in 2019 and has also been re-elected by unanimous vote until 2023. Under Steffen Roehn’s leadership, the Board has increased membership growth and satisfaction, and collaboration across many initiatives, including Diversity and Inclusion, ODA, an annual Digital Transformation World Series event and the high-impact co-innovation global Catalyst program, contributing to TM Forum’s growth and success.
“Telco operators are the backbone of digital society, but they often struggle to change course rapidly, innovate effectively and scale fast. The initiatives and frameworks we are building at TM Forum offer a smart way out. Communication Service Providers can leverage all the new software capabilities out there across our telco and solution provider members. This vision for industry-wide co-innovation – made by our members for our members and beyond – is at the heart of what TM Forum and the Board of Directors are trying to achieve. Both the Board of Trustees, and I, are very pleased to welcome Koen to join the movement and assist us in achieving our goal of industry-driven digital transformation”, remarks Roehn.
TM Forum is due to release further announcements about the progression of ODA, its growing manifesto signatories and how it’s becoming a driving force in enabling the competitive agility, innovation and growth our industry so desperately needs.  An ODA business value co-written whitepaper with Accenture launches later this month.

Da, ovog nema niti u Sjevernoj Koreji, znam jer sam bil tam! 

U cilju istinitog informiranja javnosti, moram se pitati da li Emil Gredičak namjerno piše lažne postove ili stvarno ne kuži da je 4 godine radio u najmanju ruku jako loše?! 

Prvo je odustao od projekta svlačionica koji je dobio građevinsku dozvolu i projektirao nove svlačionice sistemom modularne gradnje, a sve pod krinkom jeftinije izgradnje za koju je tvrdio da iznosi otprilike 840 tisuća kuna. 

Kad je raspisao natječaj došla je jedna ponuda i to na 2.759.146,25 kuna s pdv-om, što je još gore cijena ponude nakon provjere računske ispravnosti ponude iznosi 3.825.809,13 kn s pdv-om. 

Naravno da sam natječaj poništio, što mi je bila i zakonska obaveza i tražio rješenja koja su našem budžetu prihvatljiva. Temeljem članka 298. stavka 1. točke 9.  ZJN 2016 javni naručitelj obvezan je poništiti postupak javne nabave ako je cijena najpovoljnije ponude veća od procijenjene vrijednosti nabave, osim ako javni naručitelj ima ili će imati osigurana sredstva.

Što više i u Zapisniku o pregledu i ocjeni ponuda koji su ovjerili predstavnici stručnog povjerenstva Naručitelja, u sastavu Stanko Čičko (tadašnji predsjednik Gradskog Vijeća), Zdenka Knezić i Stana Kurtov donijeli su zaključak o razlozima za poništenje postupka nabave “jer je cijena ponude znatno veća od planiranih odnosno osiguranih sredstava, Naručitelj će poništiti ovaj postupak javne nabave”. 

Naravno da je Emil Gredičak o ovome sve znao i za sad toliko o istinitom informiranju javnosti bivšeg gradonačelnika!

&amp;lt;U+0001F4E3&amp;gt;Gradonačelnik Oroslavja izračunao je otkupnu cijenu mobitela!
 Zahvaljujem gradonačelniku Oroslavja na poslanoj uplatnici na iznos od 1800 kuna, koji sam sa zadovoljstvom odmah uplatio. Nakon što sam od njegove strane prozivan u nacionalnim medijima, dobio sam naposljetku i priliku normalno riješiti ovaj slučaj. Vjerujem da će svi portali ovo napisati, a ja moram ponoviti, najprije zbog svoje djece, obitelji i svih vas mojih prijateljica, prijatelja, poznanica i poznanika.&amp;lt;U+0001F64B&amp;gt;&amp;lt;U+200D&amp;gt;&amp;gt;&amp;lt;U+FE0F&amp;gt;
    &amp;lt;U+0001F4CD&amp;gt; Za telefon i broj sam s istekom mandata preuzeo obvezu plaćanja. (dokaz u prilogu) 
    &amp;lt;U+0001F4CD&amp;gt;Pitao sam u Jedinstveni upravni odjel grada (čiji je to djelokrug rada), da li i dalje postoji bilo kakva obveza koju sam naravno spreman podmiriti. Rečeno mi je da ne postoji ako dalje ja nastavljam plaćati obveze i da predočim dokaz prebacivanja obveze na moje ime. To sam i učinio i to je postupak koji je odobren i mojem prethodniku. 
    &amp;lt;U+0001F4CD&amp;gt;Prozivan sam u nacionalnim medijima kao osoba koja ne želi nešto tuđe vratiti, čak i za drugi mobitel koji ja ne posjedujem-zeleni Samsung S10+. 
    &amp;lt;U+0001F4CD&amp;gt;Ponovno sam spomenuo da sam spreman bilo kakvu obvezu podmiriti ako ona postoji i da sam već i javno i stručnim službama to javio. 
    &amp;lt;U+0001F4CD&amp;gt;Danas, 19.07. Konačno dam dobio uplatnicu s Odlukom gradonačelnika i sa zadovoljstvom platio ne ulazeći uopće u način obračuna.&amp;lt;U+0001F642&amp;gt;
    &amp;lt;U+0001F4CD&amp;gt;Ako treba, vratiti ću i troškove izrade majica za Viktora Šimunića i njegove prijatelje (i novoizabranog potpredsjednika Gradskog vijeća) kada su putovali u Černobil. Naime, tada me kao gradonačelnika Viktor zamolio da mu grad pomogne oko putovanja. Rekao sam da mu preko grada ne mogu pomoći novčano za put, ali ako promoviraju grad u medijima i putopisima, mogu im se izraditi majice sa grbom grada kao reklama i suvenir. Tada sam to smatrao dobrom merketinškom odlukom za grad...

P. S. Još uvijek čekam da Viktor prijavi donacije za video snimke i ostalo u predizbornoj kampanji, a koje je na sučeljavanju na N1 televiziji obećao prijaviti.

Vezano uz novo "plakanje" na Index-u, ispada da sam ipak bio u pravu kad sam odgovorio na izjavu sadašnjeg gradonačelnika da "nije učinjeno apsolutno ništa po pitanju svlačionica unatrag 30 godina". Očito se radilo puno, a naknadnom izjavom i sam sebe demantira kad nabraja kronološki što je sve učinjeno. Što se mobitela i pretplate tiče, za isti sam preuzeo otplatu prestankom mojeg mandata, te sam o tome obavjestio Jedinstveni upravni odjel koji je zadužen za te poslove. Znači, koristio sam ga tijekom rada i prestankom više ne postoji trošak za grad. Ukoliko postoji obveza bilo kakvog plaćanja gradu, naravno da sam spreman platiti i to sam rekao tada i sada opet ponavljam. Rečeno mi je da obveza ne postoji, ako sam preuzeo daljnje plaćanje i pretplatu. Na isti način regulirano je i prebacivanje broja i mobitela i mojem prethodniku prije 4 godine. A Samsung S10+ nije u mojem posjedu. Viktor to također zna. 
P. S. Nekoliko puta sam, pa i na prošlom Gradskom vijeću pokušao objasniti da prva verzija svlačionica, iako lijepa, nije bila projektirana prema standardima lige, trebao bi se rušiti stoljetni hrast, bile bi preblizu igralištu i gradile bi se djelom na potrebnom pomoćnom igralištu...itd. Također, na vijeću nije bez razloga prihvaćen drugi i noviji projekt, za kojega se opet može raspisati gradski natječaj, jer ponavljam, sve drugo je kupovina vremena...vidjet ćete.

   &lt;td style="text-align:left;"&gt; NOVENA AI SANTI GIOACCHINO ED ANNA
GENITORI DELLA BEATA VERGINE MARIA
(dal 17 al 25 luglio)

1° GIORNO

O gloriosa madre di Maria, sant'Anna, per quell'invitta pazienza con cui tollerasti la tua penosa sterilita, ottieni a noi pure una costante rassegnazione in tutti i travagli di questa vita.

Gloria...

- PREGHIERA A SANT'ANNA
(da recitarsi ogni giorno)

Anna, donna veramente beata, dal frutto del tuo seno abbiamo la gioia di contemplare la Madre di Dio fatto uomo.
Madre Anna, quale mente non si sente smarrita e quale pensiero potra rialzarsi tanto in alto da eguagliare l'onore e il privilegio che Dio altissimo ti ha riservato scegliendoti quale madre di Maria.
Madre Anna, ti mantenevi piccola e nascosta, raccolta in una umile casetta o nel segreto del tempio, unita al tuo sposo Gioacchino e attendevi con trepidazione le compiacenze del Padre Celeste che chinandosi su di te ti disponeva ad essere la Nonna di Gesu.
Madre Anna, donna veramente beata, a te affidiamo le nostre preghiere, i nostri bisogni, le nostre ansie, dividili con noi e presentale al tuo nipotino Gesu.
Stringici a te, portaci in braccio come facevi con Maria e non lasciarci fino a quando non ti raggiungeremo nella Patria Beata. Amen

Sant'Anna, madre della Madre di Dio, prega per noi.

- PREGHIERA A SAN GIOACCHINO
(da recitarsi ogni giorno)

O grande e glorioso san Gioacchino, quanto sono felice pensando che fosti eletto fra tutti i santi a cooperare ai divini misteri e ad arricchire il mondo della Madre di Dio, Maria Santissima! Per questo singolare privilegio divenisti potentissimo presso la Madre e il Figlio, per ottenerci le grazie necessarie. Con tale fiducia ricorro alla tua protezione e ti raccomando tutte le necessita mie e della mia famiglia, spirituali e temporali; ti raccomando inoltre la grazia particolare che desidero e che attendo dalla tua paterna intercessione... e poiché fosti modello perfetto di vita interiore, ottienimi il raccoglimento e il distacco da tutti i beni passeggeri di questa terra e un amore vivo e perseverante a Gesu e a Maria. Ti prego d'implorare per me all'Eterno Padre devozione e obbedienza sincera alla santa Chiesa e al sommo Pontefice che la governa, e ti prego di chiedere al Signore che io possa vivere e morire nella fede, speranza e carita perfette, invocando i nomi Santissimi di Gesu e di Maria, e salvarmi. Amen.

Gloria...

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

 2° GIORNO

O gloriosa madre di Maria, sant'Anna, per la fervorosa ed incessante preghiera con cui chiedevi a Dio di essere consolata con la fecondita, ottienici un vero spirito di preghiera per accrescere nel nostro cuore sante virtu.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

 Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

 3° GIORNO

O gloriosa madre di Maria, sant'Anna, per la rigorosa mortificazione che unisti alle tue preghiere per essere piu facilmente esaudita da Dio, fa' che anche noi accompagniamo il fervore dell'orazione con lo spirito della mortificazione per renderci meritevoli di grazie celesti.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

 Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

~*~*~*

4°  GIORNO

O gloriosa madre di Maria, sant'Anna, per la dolce violenza che facesti al Cuore di Dio con le tue grandi elemosine ed opere di carita, ottienici dal Signore una carita simile alla tua, affinché Egli abbia misericordia di noi.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

 Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

 5° GIORNO

O gloriosa madre di Maria, sant'Anna, per la santa fiducia con cui speravi la realizzazione dei tuoi desideri, ottienici una fiducia fermissima, con cui ci assicuriamo i favori del Cielo.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

 Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

6° GIORNO

O gloriosa madre di Maria, sant'Anna, per la grande riconoscenza che dimostrasti a Dio quando ti accorgesti di divenire madre per sua grazia, fa' che siamo sempre grati e riconoscenti a Dio per i continui favori che riceviamo da Lui e ci rendiamo degni di riceverne ancora.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

7° GIORNO

O gloriosa madre di Maria, sant'Anna, per quel puro e santo amore che concepisti verso Maria quando diventasti sua fortunatissima madre, ottienici di amare sempre questa tua Figlia cosi santa e nostra Madre cosi cara, per meritarci la sua protezione.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

8° GIORNO

O gloriosa madre di Maria, sant'Anna, per il grande sacrificio di offrire la tua Bambina fin dai piu teneri anni al divino servizio del tempio, ottienici di poter con santo coraggio sacrificare a Dio qualunque cosa Egli voglia chiederci per obbedire alla sua santa Volonta e per ottenere le sue benedizioni.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

9° GIORNO

O gloriosa madre di Maria, sant'Anna, per quella santita fervorosa con cui servisti Dio in tutti i giorni della tua vita, degnati di pregare il Signore di farci vivere da giusti e santi sino alla fine dei nostri giorni.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

~*~*~*

   &lt;td style="text-align:left;"&gt; NOVENA AI SANTI GIOACCHINO E ANNA GENITORI DELLA B.V. MARIA
(dal 17 al 25 luglio)

4° Giorno 20 luglio
O gloriosa madre di Maria, sant'Anna, per la dolce violenza che facesti al Cuore di Dio con le tue grandi elemosine ed opere di carita, ottienici dal Signore una carita simile alla tua, affinché Egli abbia misericordia di noi.
Gloria al Padre...
Sant'Anna, madre della Madre di Dio, prega per noi.

PREGHIERA A SAN GIOACCHINO (da recitarsi ogni giorno)
O grande e glorioso san Gioacchino, quanto sono felice pensando che fosti eletto fra tutti i santi a cooperare ai divini misteri e ad arricchire il mondo della Madre di Dio, Maria Santissima! Per questo singolare privilegio divenisti potentissimo presso la Madre e il Figlio, per ottenerci le grazie necessarie. Con tale fiducia ricorro alla tua protezione e ti raccomando tutte le necessita mie e della mia famiglia, spirituali e temporali; ti raccomando inoltre la grazia particolare che desidero e che attendo dalla tua paterna intercessione... e poiché fosti modello perfetto di vita interiore, ottienimi il raccoglimento e il distacco da tutti i beni passeggeri di questa terra e un amore vivo e perseverante a Gesu e a Maria.
Ti prego d'implorare per me all'Eterno Padre devozione e obbedienza sincera alla santa Chiesa e al sommo Pontefice che la governa, e ti prego di chiedere al Signore che io possa vivere e morire nella fede, speranza e carita perfette, invocando i nomi Santissimi di Gesu e di Maria, e salvarmi. Amen.
Gloria al Padre...
San Gioacchino, felice padre della Madre di Dio, prega per noi.

   &lt;td style="text-align:left;"&gt; Ivančica Markovinović Huawei Vaš je napisani tekst vrijedan divljenja i tu nema ništa spornoga. Veoma bogato opisan njegov rekao bih to Križni put sa mnogim zaprekama koje su iskrsle ispred njega i sve je to vrijedno divljenja i poštovanja. Ono o čemu sam ja napisao moje je viđenje cjelokupne priče o situaciji u kojoj se trenutno našao. Uz dužno poštovanje nemam namjeru nabrajati ni dobre ni loše političare ni ljude jer svatko od njih ostaviti će svoje tragove za budućnost za one koji njihovo dejstvovanje žele vagati ili ocijenjivati. Moje je mišljenje da niti jedan politički aktivista nije zaslužio prolaznu ocjenu spram svih obećanja koja su nudili Narodu koji je želio vjerovati tim obećanjima a kroz sve ove godine provlačila su se samo razočaranja u sve i svakoga. Živjeli smo u vjeri da uz sva prirodna bogatstva kojima nas je sama priroda nagradila samo mali korak treba do sreće u koju smo vjerovali ali to se dogodilo nije. Ostale su samo prazne riječi od kojih nitko osim Elite nikakve koristi nije imao što je vidljivo iz trenutnog viđenja Naroda koji je doživio razočaranje i teško da će u dogledno vrijeme itko na političkoj sceni promijeniti nešto na bolje. Moje pisanje teksta o Škorinom povlačenju sa mjesta Predsjednika Domovinskoj Pokreta je moje viđenje cjelokupne priče. Jedino čemu se mogu nadati da nije odustao od svega iz zdravstvenih razloga jer sve drugo je bio njegov osobni odabir. &lt;/td&gt;

   &lt;td style="text-align:left;"&gt; Wario Odic Najbolji dokaz ko i da li je neko nekog zeznuo, vidjet ćemo posle tako željenih promjena i da li će pevati, plesati, družiti se i uživati u životu u budućnosti kada ulete u potrošački kapitalisticku mašinu.... Ima Kuba da postane ono što smo mi evropi postali, supak koji se proguta svo sranje za koje bi ameri morali platiti reciklažu, naravno onda će im se i zdravstvo privatizovati, vrati će se kazina i Bordelji, ima da uživaju kao i mi na balkanu ili kako žive južni 'korejci' a malo ljudi zna kako žive ljudi tj. Roblje uspešnih i bogatih kapitalisticki država posebno penzioneri ali i skolarci, osnovci, srednjoskolci.... Najbolje u svemu da se kapitalizam grčevito bori protiv nadolazeće Socijalizam, zato su i požurili sa električnom automobili a i ovom virtualnom valutnom koja bi trebala biti u našim glavama usadjena u planiranim čipovima ali to je samo utopija ili kako žele prikazati da je to komunistička diktatura koju je Huawei već započeo, čak se dobrano umešao u ovu kripto valutu na kojoj zaradjuješ.... Živjela nam nova religijsko kapitalistički revolucija u kojoj se treba smanjiti broj potrošača kako bi ostatak utopistička uživao, bar tako misle i planiraju američka država i svi sateliti iste.... Jos samo uništiti neposlušne i koji koče napredak ili žele zaustaviti evolucijski napredak koronalnog virusa kojitek do delte došao a ostalo je još 20tak slova grčkog alfabeta.... Živjela teorije zavera.... Ili to možda nisu.... &lt;/td&gt;

   &lt;td style="text-align:left;"&gt; Dragana Marjanović znaći, možemo zaključiti:
- bez veze je slušati struku?
- vi ne slušate struku jer to znate bolje od njih?

Da, krenimo od početka, tko je objavljivao da ljudi padaju? Koliko sam ja primjetio nije javna televizija, niti poznati doktori, niti ozbiljni portali, nego žuta štampa koja i sada radi po principu: “primio cjepivo, klikni i vidi što se tada dogodilo”, obavezno like. Propagandu su širili nebitni portali i novine kako bi skupili lajkove i klikove. Isto kao i: “klikni i napiši da, i na kućnu adesunti stiže iphon”, ili upiši da i prvih 1000 dobija novi Samsung, ljudi klikaju i vjeruju.

Uvijek neki čudni portali. 

Imao sam prilike upoznati ljude mlađe od mene koji su u dobroj formi te su imali strašnih problema. Imao sam priliku jer mi je takav posao, pričati sa mnogim doktorima koje poznajem godinama, koji djeluju u raznim ustanovama u svojoj branši, i mogu vam reći da oni koji tvrde da je to izmišljotina i bezazleno, čisto pres….. onih koji žele biti doktori iznad doktora a do jučer su se bavili sa svime i svaćime. Oduvijek su ljudi umirali i od drugih cijepiva, nema lijeka od kojeg nema nus pojava, nema garancije za ništa, ali svi očekujemo da nam ri isti doktori pomognu kada smo u frci i bolesni, a sada ih pljujemo a sebe prozivamo velikim stručnjacima. Ako ke takvo nepovjerenje i sumnja i njihovu stručnost, zašto ih koristite kada ste bolesni, nemojte ići na pretrage ni jednom doktoru, kada budere bolesni liječite se sami doma jer vi to znate. Stvarno ne razumijem. Gospđa mi tu navodi kako ona gleda Youtube a ne televiziju., o isusek…., gleda a sa druge strane uopće nezna dali je pouzdani izvor i u to vjeruje. Ja sam za to da se nikoga ne sili na cijepljenje, ali ako obolite snosite trošak liječenja ili uplatite dodatno osiguranje. Kada idete na bilo kakvu operaciji isto morate potpisati. &lt;/td&gt;

Coventry-based biotech, NanoSyrinx has raised a further L6.2m of seed financing, co-led by incoming Octopus Ventures and existing investor M Ventures (Amsterdam, The Netherlands), the corporate venture capital arm of Merck KGaA. Previous investors BioCity and the UK Innovation &amp;amp; Science Seed Fund (...
Coventry-based biotech grabs L6.2M funding to develop its novel biologic delivery platform
Coventry-based biotech, NanoSyrinx has raised a further L6.2m of seed financing, co-led by incoming Octopus Ventures and existing investor M Ventures (Amsterdam, The Netherlands), the corporate venture capital arm of Merck KGaA.
Previous investors BioCity and the UK Innovation &amp;amp; Science Seed Fund (UKI2S) joined the funding round along with experienced deeptech investor IQ Capital and Jonathan Milner. The round was significantly oversubscribed with high demand both from existing and from new investors.
Transforming treatments
NanoSyrinx is the first company to engineer protein ‘nanosyringes’, a cell-selective non-viral peptide and protein delivery system. Targeted delivery of therapeutics is an important solution to improve efficacy and minimise potential side effects of existing and new treatments. NanoSyrinx’s technology has the potential to transform the treatment of a wide range of diseases. The system overcomes a number of challenges experienced in intracellular delivery such as cell specificity, payload limitations and manufacturing complexities.
The company will use this investment to fully investigate the applications of its technology across a range of therapeutic indications and novel modalities. Proof-of-concept studies both for in vivo active pharmaceutical delivery and ex vivo cell engineering will be undertaken to better understand the optimal clinical targets and to build a pipeline of programmes to take forward in the next phase of growth.
Dr Joe Healey, CEO of NanoSyrinx, commented: “We’re thrilled that all our current investors have recognised the tremendous progress made by the company in 2020 and have chosen to continue supporting us. It is also a pleasure to welcome Octopus, IQ Capital and Jonathan Milner to the syndicate and we’re delighted to be working together. This investment will help us develop our approach to best target those therapeutic areas where we can make the biggest impact.”
Dr Uzma Choudry, early-stage investor at Octopus Ventures, commented: “Targeting diseased cells without affecting healthy cells is the holy grail of medicine. That’s why we’re so excited to be backing the brilliant NanoSyrinx team in developing their targeted (biologics) delivery platform to treat disease. The initial applications of this technology will be the cell and gene therapy space, where we could see it being used to create highly effective cancer treatments with significantly reduced side effects. The opportunity is enormous and we are looking forward to working with Joe and the team to help make NanoSyrinx’s vision a reality.”
Dr Arnaud Autret, Investment Principal at M Ventures, said: “NanoSyrinx has made very good progress since our pre-seed investment and we are excited to continue backing the NanoSyrinx team and to welcome strong new investors. This new raise will support further developments of this truly differentiated approach in the field of non-viral delivery systems for cell and gene therapy, a high-growth market.”
NanoSyrinx Ltd was founded in 2020 to develop a fully customisable genetic platform that selectively delivers peptide and protein payloads directly to the cytosol of targeted cells. It was first identified by the Waterfield Lab based at Warwick Medical School at the University of Warwick.

   &lt;td style="text-align:left;"&gt; Povijesni uspjeh: Xiaomi je broj jedan u Hrvatskoj i drugi na svijetu

Kineski proizvođač mobilnih telefona i drugih uređaja Xiaomi u Hrvatskoj po isporuci pametnih telefona zauzima prvo mjesto, ostvarivši 40 posto tržišnog udjela te godišnji porast od 65 posto, obavještavaju iz ureda Xiaomi Internationala za Hrvatsku i Sloveniju.

"Ovo je povijesni Xiaomijev rezultat u Hrvatskoj", kaže Mirela Polić, marketinška menadžerica te kompanije za Hrvatsku i Sloveniju, dodavši kako se ti rezultati temelje na podacima nekoliko globalnih analitičkih i istraživačkih kuća za globalno tržište pametnih telefona (Canalys, IDC i Strategy Analytics).

U Hrvatskoj je, po tim podacima, iza Xiaomija, na drugom mjestu po broju isporučenih pametnih telefona Samsung, sa tržišnim udjelom od 36 posto i porastom isporuka od 25 posto, dok je treći Apple s udjelom na tržištu od 6 posto i porastom od 17 posto. Na četvrtom je mjestu HMD Global s udjelom od 4 posto, i porastom isporuka od 210 posto.

Što se tiče svjetskog tržišta, Xiaomi bilježi ogroman porast i trenutno je na drugom mjestu iza Samsunga.

"Dobili smo izvješće Canalysa, vodeće svjetske tvrtke za istraživanje tržišta o globalnom tržištu pametnih telefona na kojem je Xiaomi zauzeo drugo mjesto sa 17 posto udjela i 83 posto međugodišnjeg rasta, nadmašivši Apple", kaže Mirela Polić te dodaje kako je: "Canalys objavio da Xiaomi sada transformira svoj poslovni model iz izazivača u pozicioniranog lidera pametnih telefona i to zahvaljujući inicijativama poput konsolidacije partnera i pažljivijeg upravljanja na otvorenom tržištu. Canalys je komentirao da je novi cilj Xiaomija istisnuti Samsung kako bi postao najveći svjetski prodavač".

U pismu svim zaposlenicima, Lei Jun, osnivač, predsjednik i izvršni direktor Xiaomija, istaknuo je da je zauzimanje drugog mjesta na globalnom tržištu ključna prekretnica u povijesti Xiaomijeva poslovanja. "Nakon pet godina kontinuiranog ulaganja u segmentu unaprjeđenja, a koje se odvijalo u izuzetno teškim uvjetima, Xiaomijeve proizvodne mogućnosti znatno su poboljšane. Xiaomi je otvorio put u premium segment tržišta i povećao svoj tržišni udio. Xiaomi će kontinuirano jačati svoje temeljne sposobnosti i učvršćivati svoje mjesto kao drugi najveći brend pametnih telefona", rekao je Lei Jun.

Inače, započela je s radom prva faza Xiaomijeve pametne tvornice. Proizvodne linije su automatizirane i sposobne proizvesti milijun vrhunskih pametnih telefona godišnje, a tu je ujedno i ogroman laboratorijski pogon koji Xiaomiju omogućuje istraživanje novih materijala i tehnologija, kao i testiranje naprednih proizvodnih i proizvodnih procesa. Inovacije su dio Xiaomijeve kulture i tvrtka znatno ulaže u istraživanje i razvoj i zapošljavanje najboljih talenata. Xiaomi je uložio gotovo 10 milijardi RMB u istraživanje i razvoj 2020. godine, ove godine očekuje se porast broja za od 30 do 40 posto. U međuvremenu, Xiaomi je pokrenuo više inicijativa za poticanje nadarenosti, poput projekta dodjele milijun američkih dolara za tehnološke talente, poticajnog plana za mlade inženjere itd.

Prema najnovijim globalnim podacima o pametnim telefonima Canalysa, Xiaomi se brzo širi na inozemnim tržištima, dosežući preko 300 posto međugodišnjeg rasta na tržištu Latinske Amerike, preko 150 posto međugodišnjeg rasta u Africi i preko 50 posto međugodišnjeg rasta u zapadnoj Europi. Prema najavi rezultata Xiaomi za Q1 2021, pametni telefoni Xiaomi ušli su na više od 100 tržišta širom svijeta, svrstali se na prvo mjesto po udjelu na tržištu pametnih telefona na 12 tržišta i na 2. mjesto u Europi. Godinama je također broj 1 u Indiji. (Ivica Korman) #Kina #Hrvatska #Gospodarstvo #Xiaomi

TM Forum appoints Orange Group CIO, Koen Vermeulen, as Board Member to drive industry innovation
The appointment coincides with the re-election of Chairman Steffen Roehn, and a rapid period of growth for TM Forum including over 100 new members
TM Forum, the industry association driving digital transformation through collaboration, announces Koen Vermeulen, Orange Chief Information Officer, and Senior Vice President of Orange Innovation IT and Services, to its Board of Directors. The appointment of Koen Vermeulen comes as part of a period of momentum at TM Forum including a recent partnership with the Tech Talent Charter to help drive inclusivity and diversity in the telco industry, the addition of over 100 new members during 2020_21, increased high-impact co-innovation through its global Catalyst program and industry defining advancements to achieve its zero-touch objectives through its Open Digital Architecture (ODA.)
Koen Vermeulen brings a wealth of experience spanning 20+ years in telco and the internet industries, alongside innovation and digital transformation, to TM Forum’s Board of Directors. Specifically, he expands on the Board’s knowledge of delivering innovative B2C and B2B communication services. Under his leadership as CIO at Orange in France, he has accelerated the implementation of a digital and information strategy that is transformative in its ambition to deliver cutting-edge solutions for Global customers.
The Board, which also includes senior executives from Axiata, BT, China Mobile, Deloitte, Deutsche Telekom, Ericsson, Huawei, Microsoft, Nokia, Oracle, Telenor and Verizon, has overall responsibility for TM Forum on behalf of its more than 850 members. Its key responsibilities are to determine how the Forum will serve the industry, set strategy, direction, and priorities, and guide strategic initiatives. Of the now 15 board members with the appointment of Koen Vermeulen, 10 have recently been reappointed to a further two-year term with four members at the mid-term stage. The continued terms of the senior executives already on the Board shows the strength of the various trustees and their commitment to continue bringing value and innovation to the industry.
On his appointment, Koen Vermeulen comments: “The worldwide telco movement for digital transformation will require companies to evolve, rethink traditional models and adopt new activities. We need open innovation and collaboration to drive industry transformation, which is exactly what TM Forum is doing. I am honoured to join the Board and share my ambition for the industry and contribute to the work the Forum is achieving.”
Alongside continuing vice chairs, Harmeen Mehta, Chief Digital and Innovation Officer, BT and Michael Lawrey, Former TM Forum Chairman, the board chairman is Steffen Roehn, Partner of Bain &amp;amp; Company, a top management consulting firm. Steffen Roehn was first appointed Chairman in 2019 and has also been re-elected by unanimous vote until 2023. Under Steffen Roehn’s leadership, the Board has increased membership growth and satisfaction, and collaboration across many initiatives, including Diversity and Inclusion, ODA, an annual Digital Transformation World Series event and the high-impact co-innovation global Catalyst program, contributing to TM Forum’s growth and success.
“Telco operators are the backbone of digital society, but they often struggle to change course rapidly, innovate effectively and scale fast. The initiatives and frameworks we are building at TM Forum offer a smart way out. Communication Service Providers can leverage all the new software capabilities out there across our telco and solution provider members. This vision for industry-wide co-innovation – made by our members for our members and beyond – is at the heart of what TM Forum and the Board of Directors are trying to achieve. Both the Board of Trustees, and I, are very pleased to welcome Koen to join the movement and assist us in achieving our goal of industry-driven digital transformation”, remarks Roehn.
TM Forum is due to release further announcements about the progression of ODA, its growing manifesto signatories and how it’s becoming a driving force in enabling the competitive agility, innovation and growth our industry so desperately needs.  An ODA business value co-written whitepaper with Accenture launches later this month.

   &lt;td style="text-align:left;"&gt; Medij: Tehnološki rat između Kine i SAD-a će skupo koštati svijet

Sjedinjene Američke Države pokušavaju obuzdati uspon Kine u takozvanom tehnološkom hladnom ratu, koji postaje odlučujuća bojišnica za konkurenciju između dvije zemlje, navedeno je u članku koji je nedavno objavio australski medij ABC News.

Kina je tijekom posljednjih godina ulagala znatna sredstva u umjetnu inteligenciju, 5G i 6G tehnologiju, mikročipove i tehnologiju za nadzor, brzo sustižući Sjedinjene Američke Države koje su dugo imale prednost u tehnologiji, navedeno je u članku.

Sjedinjene Američke Države pokušavaju suzbiti razvoj Kine u tehnološkoj industriji. Zabranile su Huaweijevu 5G mrežu u zemlji i učinkovito spriječile da tvrtke iz SAD-a opskrbljuju kineske tehnološke tvrtke softverom i komponentama.

Međutim, analitičari upozoravaju da će takvi sukobi samo učvrstiti “digitalnu željeznu zavjesu” između Zapada i Kine, dodajući kako se svijet dijeli između dva sukobljena i uzajamno isključujuća tehnološka ekosustava, koji svaki ima vlastite internetske, hardverske, komunikacijske i financijske platforme.

“Tehnološki rat je izazvao žrtve na obje strane i skupo će koštati svijet”, navedeno je u članku. &lt;/td&gt;

U cilju istinitog informiranja javnosti, moram se pitati da li Emil Gredičak namjerno piše lažne postove ili stvarno ne kuži da je 4 godine radio u najmanju ruku jako loše?! 

Prvo je odustao od projekta svlačionica koji je dobio građevinsku dozvolu i projektirao nove svlačionice sistemom modularne gradnje, a sve pod krinkom jeftinije izgradnje za koju je tvrdio da iznosi otprilike 840 tisuća kuna. 

Kad je raspisao natječaj došla je jedna ponuda i to na 2.759.146,25 kuna s pdv-om, što je još gore cijena ponude nakon provjere računske ispravnosti ponude iznosi 3.825.809,13 kn s pdv-om. 

Naravno da sam natječaj poništio, što mi je bila i zakonska obaveza i tražio rješenja koja su našem budžetu prihvatljiva. Temeljem članka 298. stavka 1. točke 9.  ZJN 2016 javni naručitelj obvezan je poništiti postupak javne nabave ako je cijena najpovoljnije ponude veća od procijenjene vrijednosti nabave, osim ako javni naručitelj ima ili će imati osigurana sredstva.

Što više i u Zapisniku o pregledu i ocjeni ponuda koji su ovjerili predstavnici stručnog povjerenstva Naručitelja, u sastavu Stanko Čičko (tadašnji predsjednik Gradskog Vijeća), Zdenka Knezić i Stana Kurtov donijeli su zaključak o razlozima za poništenje postupka nabave “jer je cijena ponude znatno veća od planiranih odnosno osiguranih sredstava, Naručitelj će poništiti ovaj postupak javne nabave”. 

Naravno da je Emil Gredičak o ovome sve znao i za sad toliko o istinitom informiranju javnosti bivšeg gradonačelnika!

&amp;lt;U+0001F4E3&amp;gt;Gradonačelnik Oroslavja izračunao je otkupnu cijenu mobitela!
 Zahvaljujem gradonačelniku Oroslavja na poslanoj uplatnici na iznos od 1800 kuna, koji sam sa zadovoljstvom odmah uplatio. Nakon što sam od njegove strane prozivan u nacionalnim medijima, dobio sam naposljetku i priliku normalno riješiti ovaj slučaj. Vjerujem da će svi portali ovo napisati, a ja moram ponoviti, najprije zbog svoje djece, obitelji i svih vas mojih prijateljica, prijatelja, poznanica i poznanika.&amp;lt;U+0001F64B&amp;gt;&amp;lt;U+200D&amp;gt;&amp;gt;&amp;lt;U+FE0F&amp;gt;
    &amp;lt;U+0001F4CD&amp;gt; Za telefon i broj sam s istekom mandata preuzeo obvezu plaćanja. (dokaz u prilogu) 
    &amp;lt;U+0001F4CD&amp;gt;Pitao sam u Jedinstveni upravni odjel grada (čiji je to djelokrug rada), da li i dalje postoji bilo kakva obveza koju sam naravno spreman podmiriti. Rečeno mi je da ne postoji ako dalje ja nastavljam plaćati obveze i da predočim dokaz prebacivanja obveze na moje ime. To sam i učinio i to je postupak koji je odobren i mojem prethodniku. 
    &amp;lt;U+0001F4CD&amp;gt;Prozivan sam u nacionalnim medijima kao osoba koja ne želi nešto tuđe vratiti, čak i za drugi mobitel koji ja ne posjedujem-zeleni Samsung S10+. 
    &amp;lt;U+0001F4CD&amp;gt;Ponovno sam spomenuo da sam spreman bilo kakvu obvezu podmiriti ako ona postoji i da sam već i javno i stručnim službama to javio. 
    &amp;lt;U+0001F4CD&amp;gt;Danas, 19.07. Konačno dam dobio uplatnicu s Odlukom gradonačelnika i sa zadovoljstvom platio ne ulazeći uopće u način obračuna.&amp;lt;U+0001F642&amp;gt;
    &amp;lt;U+0001F4CD&amp;gt;Ako treba, vratiti ću i troškove izrade majica za Viktora Šimunića i njegove prijatelje (i novoizabranog potpredsjednika Gradskog vijeća) kada su putovali u Černobil. Naime, tada me kao gradonačelnika Viktor zamolio da mu grad pomogne oko putovanja. Rekao sam da mu preko grada ne mogu pomoći novčano za put, ali ako promoviraju grad u medijima i putopisima, mogu im se izraditi majice sa grbom grada kao reklama i suvenir. Tada sam to smatrao dobrom merketinškom odlukom za grad...

P. S. Još uvijek čekam da Viktor prijavi donacije za video snimke i ostalo u predizbornoj kampanji, a koje je na sučeljavanju na N1 televiziji obećao prijaviti.

Vezano uz novo "plakanje" na Index-u, ispada da sam ipak bio u pravu kad sam odgovorio na izjavu sadašnjeg gradonačelnika da "nije učinjeno apsolutno ništa po pitanju svlačionica unatrag 30 godina". Očito se radilo puno, a naknadnom izjavom i sam sebe demantira kad nabraja kronološki što je sve učinjeno. Što se mobitela i pretplate tiče, za isti sam preuzeo otplatu prestankom mojeg mandata, te sam o tome obavjestio Jedinstveni upravni odjel koji je zadužen za te poslove. Znači, koristio sam ga tijekom rada i prestankom više ne postoji trošak za grad. Ukoliko postoji obveza bilo kakvog plaćanja gradu, naravno da sam spreman platiti i to sam rekao tada i sada opet ponavljam. Rečeno mi je da obveza ne postoji, ako sam preuzeo daljnje plaćanje i pretplatu. Na isti način regulirano je i prebacivanje broja i mobitela i mojem prethodniku prije 4 godine. A Samsung S10+ nije u mojem posjedu. Viktor to također zna. 
P. S. Nekoliko puta sam, pa i na prošlom Gradskom vijeću pokušao objasniti da prva verzija svlačionica, iako lijepa, nije bila projektirana prema standardima lige, trebao bi se rušiti stoljetni hrast, bile bi preblizu igralištu i gradile bi se djelom na potrebnom pomoćnom igralištu...itd. Također, na vijeću nije bez razloga prihvaćen drugi i noviji projekt, za kojega se opet može raspisati gradski natječaj, jer ponavljam, sve drugo je kupovina vremena...vidjet ćete.

   &lt;td style="text-align:left;"&gt; NOVENA AI SANTI GIOACCHINO ED ANNA
GENITORI DELLA BEATA VERGINE MARIA
(dal 17 al 25 luglio)

1° GIORNO

O gloriosa madre di Maria, sant'Anna, per quell'invitta pazienza con cui tollerasti la tua penosa sterilita, ottieni a noi pure una costante rassegnazione in tutti i travagli di questa vita.

Gloria...

- PREGHIERA A SANT'ANNA
(da recitarsi ogni giorno)

Anna, donna veramente beata, dal frutto del tuo seno abbiamo la gioia di contemplare la Madre di Dio fatto uomo.
Madre Anna, quale mente non si sente smarrita e quale pensiero potra rialzarsi tanto in alto da eguagliare l'onore e il privilegio che Dio altissimo ti ha riservato scegliendoti quale madre di Maria.
Madre Anna, ti mantenevi piccola e nascosta, raccolta in una umile casetta o nel segreto del tempio, unita al tuo sposo Gioacchino e attendevi con trepidazione le compiacenze del Padre Celeste che chinandosi su di te ti disponeva ad essere la Nonna di Gesu.
Madre Anna, donna veramente beata, a te affidiamo le nostre preghiere, i nostri bisogni, le nostre ansie, dividili con noi e presentale al tuo nipotino Gesu.
Stringici a te, portaci in braccio come facevi con Maria e non lasciarci fino a quando non ti raggiungeremo nella Patria Beata. Amen

Sant'Anna, madre della Madre di Dio, prega per noi.

- PREGHIERA A SAN GIOACCHINO
(da recitarsi ogni giorno)

O grande e glorioso san Gioacchino, quanto sono felice pensando che fosti eletto fra tutti i santi a cooperare ai divini misteri e ad arricchire il mondo della Madre di Dio, Maria Santissima! Per questo singolare privilegio divenisti potentissimo presso la Madre e il Figlio, per ottenerci le grazie necessarie. Con tale fiducia ricorro alla tua protezione e ti raccomando tutte le necessita mie e della mia famiglia, spirituali e temporali; ti raccomando inoltre la grazia particolare che desidero e che attendo dalla tua paterna intercessione... e poiché fosti modello perfetto di vita interiore, ottienimi il raccoglimento e il distacco da tutti i beni passeggeri di questa terra e un amore vivo e perseverante a Gesu e a Maria. Ti prego d'implorare per me all'Eterno Padre devozione e obbedienza sincera alla santa Chiesa e al sommo Pontefice che la governa, e ti prego di chiedere al Signore che io possa vivere e morire nella fede, speranza e carita perfette, invocando i nomi Santissimi di Gesu e di Maria, e salvarmi. Amen.

Gloria...

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

 2° GIORNO

O gloriosa madre di Maria, sant'Anna, per la fervorosa ed incessante preghiera con cui chiedevi a Dio di essere consolata con la fecondita, ottienici un vero spirito di preghiera per accrescere nel nostro cuore sante virtu.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

 Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

 3° GIORNO

O gloriosa madre di Maria, sant'Anna, per la rigorosa mortificazione che unisti alle tue preghiere per essere piu facilmente esaudita da Dio, fa' che anche noi accompagniamo il fervore dell'orazione con lo spirito della mortificazione per renderci meritevoli di grazie celesti.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

 Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

~*~*~*

4°  GIORNO

O gloriosa madre di Maria, sant'Anna, per la dolce violenza che facesti al Cuore di Dio con le tue grandi elemosine ed opere di carita, ottienici dal Signore una carita simile alla tua, affinché Egli abbia misericordia di noi.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

 Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

 5° GIORNO

O gloriosa madre di Maria, sant'Anna, per la santa fiducia con cui speravi la realizzazione dei tuoi desideri, ottienici una fiducia fermissima, con cui ci assicuriamo i favori del Cielo.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

 Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

6° GIORNO

O gloriosa madre di Maria, sant'Anna, per la grande riconoscenza che dimostrasti a Dio quando ti accorgesti di divenire madre per sua grazia, fa' che siamo sempre grati e riconoscenti a Dio per i continui favori che riceviamo da Lui e ci rendiamo degni di riceverne ancora.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

7° GIORNO

O gloriosa madre di Maria, sant'Anna, per quel puro e santo amore che concepisti verso Maria quando diventasti sua fortunatissima madre, ottienici di amare sempre questa tua Figlia cosi santa e nostra Madre cosi cara, per meritarci la sua protezione.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

8° GIORNO

O gloriosa madre di Maria, sant'Anna, per il grande sacrificio di offrire la tua Bambina fin dai piu teneri anni al divino servizio del tempio, ottienici di poter con santo coraggio sacrificare a Dio qualunque cosa Egli voglia chiederci per obbedire alla sua santa Volonta e per ottenere le sue benedizioni.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

 ~*~*~*

9° GIORNO

O gloriosa madre di Maria, sant'Anna, per quella santita fervorosa con cui servisti Dio in tutti i giorni della tua vita, degnati di pregare il Signore di farci vivere da giusti e santi sino alla fine dei nostri giorni.

Gloria...

Preghiera a sant'Anna

Sant'Anna, madre della Madre di Dio, prega per noi.

Preghiera a san Gioacchino

San Gioacchino, felice padre della Madre di Dio, prega per noi.

~*~*~*

   &lt;td style="text-align:left;"&gt; NOVENA AI SANTI GIOACCHINO E ANNA GENITORI DELLA B.V. MARIA
(dal 17 al 25 luglio)

4° Giorno 20 luglio
O gloriosa madre di Maria, sant'Anna, per la dolce violenza che facesti al Cuore di Dio con le tue grandi elemosine ed opere di carita, ottienici dal Signore una carita simile alla tua, affinché Egli abbia misericordia di noi.
Gloria al Padre...
Sant'Anna, madre della Madre di Dio, prega per noi.

PREGHIERA A SAN GIOACCHINO (da recitarsi ogni giorno)
O grande e glorioso san Gioacchino, quanto sono felice pensando che fosti eletto fra tutti i santi a cooperare ai divini misteri e ad arricchire il mondo della Madre di Dio, Maria Santissima! Per questo singolare privilegio divenisti potentissimo presso la Madre e il Figlio, per ottenerci le grazie necessarie. Con tale fiducia ricorro alla tua protezione e ti raccomando tutte le necessita mie e della mia famiglia, spirituali e temporali; ti raccomando inoltre la grazia particolare che desidero e che attendo dalla tua paterna intercessione... e poiché fosti modello perfetto di vita interiore, ottienimi il raccoglimento e il distacco da tutti i beni passeggeri di questa terra e un amore vivo e perseverante a Gesu e a Maria.
Ti prego d'implorare per me all'Eterno Padre devozione e obbedienza sincera alla santa Chiesa e al sommo Pontefice che la governa, e ti prego di chiedere al Signore che io possa vivere e morire nella fede, speranza e carita perfette, invocando i nomi Santissimi di Gesu e di Maria, e salvarmi. Amen.
Gloria al Padre...
San Gioacchino, felice padre della Madre di Dio, prega per noi.

   &lt;td style="text-align:left;"&gt; nas nekoliko vec neko vrijeme testiramo bluetooth teoriju pa vam mogu napisati dosadasnja saznanja : 1.najbolje od svih isprobanih hvata ova besplatna aplikacija za android sustav https://play.google.com/store/apps/details... 2.ne radi na svim mobitelima,na vecini samsung i iphone ne radi 3. ne hvata sve cijepljene nego otprilike 60 posto njih 4. pojavljuju se kao nepoznati uredjaji na skeneru,vidljiva je samo bluetooth adresa odnosno MAC adresa 5. MAC adresa se moze provjeriti na ovoj stranici https://macvendors.com/ i slicnim stranicama (mac address list ) ,dovoljno je upisati u trazilicu na toj stranici prvih 6 brojki i slova skupa sa dvotockama i onda se pojavi proizvodjac uredjaja,ako je proizvodjac nepoznat vjerovatno se radi o cijepljenoj osobi 6. vise puta smo isprobavali i definitivno nesto ima u toj prici 7.razgovarali smo sa 2 strucnjaka i jedan kaze da je dovoljno sa cijepljenom osobom otici na livadu koja je minimalno 500 metara udaljena od ljudi i uredjaja da bi se testiralo dok drugi kaze da je siguran da to sto je ubrizgano u ljude radi uz pomoc 3G,4G i 5G antena i ako se udaljimo od dosega antena nece raditi ! izgleda da je ovaj drugi u pravu jer smo vec dvaput vodili i testirali cijepljene osobe na udaljenoj livadi i nisu se pojavili na skeneru ! uglavnom ljudima zvuci nevjerovatno ali definitivno nesto ima u toj prici,svakako su potrebna dodatna istrazivanja ! zaboravio sam napomenuti da treba ukljuciti bluetooth na vlastitom mobitelu i da na mnogim mobitelima treba iskljuciti internet da bi radilo ! pozdrav &lt;/td&gt;

   &lt;td style="text-align:left;"&gt; Dragana Marjanović znaći, možemo zaključiti:
- bez veze je slušati struku?
- vi ne slušate struku jer to znate bolje od njih?

Da, krenimo od početka, tko je objavljivao da ljudi padaju? Koliko sam ja primjetio nije javna televizija, niti poznati doktori, niti ozbiljni portali, nego žuta štampa koja i sada radi po principu: “primio cjepivo, klikni i vidi što se tada dogodilo”, obavezno like. Propagandu su širili nebitni portali i novine kako bi skupili lajkove i klikove. Isto kao i: “klikni i napiši da, i na kućnu adesunti stiže iphon”, ili upiši da i prvih 1000 dobija novi Samsung, ljudi klikaju i vjeruju.

Uvijek neki čudni portali. 

Imao sam prilike upoznati ljude mlađe od mene koji su u dobroj formi te su imali strašnih problema. Imao sam priliku jer mi je takav posao, pričati sa mnogim doktorima koje poznajem godinama, koji djeluju u raznim ustanovama u svojoj branši, i mogu vam reći da oni koji tvrde da je to izmišljotina i bezazleno, čisto pres….. onih koji žele biti doktori iznad doktora a do jučer su se bavili sa svime i svaćime. Oduvijek su ljudi umirali i od drugih cijepiva, nema lijeka od kojeg nema nus pojava, nema garancije za ništa, ali svi očekujemo da nam ri isti doktori pomognu kada smo u frci i bolesni, a sada ih pljujemo a sebe prozivamo velikim stručnjacima. Ako ke takvo nepovjerenje i sumnja i njihovu stručnost, zašto ih koristite kada ste bolesni, nemojte ići na pretrage ni jednom doktoru, kada budere bolesni liječite se sami doma jer vi to znate. Stvarno ne razumijem. Gospđa mi tu navodi kako ona gleda Youtube a ne televiziju., o isusek…., gleda a sa druge strane uopće nezna dali je pouzdani izvor i u to vjeruje. Ja sam za to da se nikoga ne sili na cijepljenje, ali ako obolite snosite trošak liječenja ili uplatite dodatno osiguranje. Kada idete na bilo kakvu operaciji isto morate potpisati. &lt;/td&gt;
